import { Link } from "react-router-dom";
// const links = [
//   {
//     title: "Home",
//     link: "/"
//   },
//   //   add the other link as well
// ];
export const Navbar = () => {
  return (
    <>
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
      <Link to="/product">Product</Link>
      <Link to="/SingleProduct">SingleProduct</Link>
    </>
  );
  //map through the link ad display it in header
};
